import React, {Component} from 'react'
import axios from 'axios'

class Youtube extends Component {


async fetchVideo() {
    let res = await axios.get(`https://www.googleapis.com/youtube/v3/search?key=AIzaSyDZ45_22-Kzo_oZGO0ClgxbX7vuvT3M5-w`, {
        params: {
            part: 'snippet',
            maxResults: 5,
            key: 'AIzaSyDZ45_22-Kzo_oZGO0ClgxbX7vuvT3M5-w'
        }
    })
    console.log(res)
}


render(){
    return (
        <div></div>
    )
}
}

export default Youtube;
